import {Container} from 'react-bootstrap'
import './App.css';

function App() {

  const divStyle = {
    fontSize: 'var(--fs-display)',
    color: 'var(--accent-success)',
  }

  const test = {
    width: '200px',
    height: '200px',
    backgroundColor: 'var(--accent-pink)',
    borderRadius: 'var(--br-md)'
  }
    return ( 
    <div className = "App" >
      <Container>
        <div style={divStyle} className="fs-display">This is a display</div>

        <div style={test}>holoholo</div>
      </Container>
    </div>
    );
}

export default App;
